begin
wwv_flow_imp_shared.create_automation(
 p_id=>wwv_flow_imp.id(42307092352868363)
,p_name=>'Geocode Missing Coordinates and Identify Point of Interest'
,p_static_id=>'geocode-missing-coordinates-and-identify-point-of-interest'
,p_trigger_type=>'API'
,p_polling_status=>'DISABLED'
,p_result_type=>'ROWS'
,p_location=>'LOCAL'
,p_use_local_sync_table=>false
,p_query_type=>'SQL'
,p_query_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select id, address, null as longitude, null as latitude, null as poi, null as geojson',
'  from eba_demo_addresses',
' where longitude is null',
'    or latitude  is null'))
,p_include_rowid_column=>false
,p_commit_each_row=>false
,p_error_handling_type=>'IGNORE'
);
wwv_flow_imp_shared.create_automation_action(
 p_id=>wwv_flow_imp.id(42307301726868359)
,p_automation_id=>wwv_flow_imp.id(42307092352868363)
,p_name=>'Geocode Address'
,p_execution_sequence=>10
,p_action_type=>'NATIVE_GEOCODING'
,p_attribute_01=>'STATIC'
,p_attribute_02=>'US'
,p_attribute_04=>'N'
,p_attribute_05=>'N'
,p_attribute_06=>'ADDRESS'
,p_attribute_13=>'GEOJSON'
,p_location=>'LOCAL'
,p_stop_execution_on_error=>true
);
wwv_flow_imp_shared.create_automation_action(
 p_id=>wwv_flow_imp.id(60469725813725375)
,p_automation_id=>wwv_flow_imp.id(42307092352868363)
,p_name=>'Extract Longitude/Latitutde'
,p_execution_sequence=>20
,p_action_type=>'NATIVE_PLSQL'
,p_action_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select longitude, latitude',
'into :LONGITUDE, :LATITUDE',
'from json_table(:GEOJSON, ''$.coordinates'' ',
'   columns (',
'      longitude number path ''$[0]'',',
'      latitude number  path ''$[1]''',
'   ));',
''))
,p_action_clob_language=>'PLSQL'
,p_location=>'LOCAL'
,p_stop_execution_on_error=>true
);
wwv_flow_imp_shared.create_automation_action(
 p_id=>wwv_flow_imp.id(60470179109734603)
,p_automation_id=>wwv_flow_imp.id(42307092352868363)
,p_name=>'Use GenAI to Infer Point of Interest'
,p_execution_sequence=>30
,p_action_type=>'NATIVE_PLSQL'
,p_action_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select poi',
'into :POI',
'from json_table(',
'    apex_ai.generate(',
'        p_config_static_id => ''poi_lookup'',',
'        p_prompt => json_object(',
'                        ''address''   value :ADDRESS,',
'                        ''longitude'' value :LONGITUDE,',
'                        ''latitude''  value :LATITUDE)),',
'    ''$''',
'    columns (',
'        poi varchar2(4000) path ''$.poi''',
'    )',
');'))
,p_action_clob_language=>'PLSQL'
,p_location=>'LOCAL'
,p_stop_execution_on_error=>true
);
wwv_flow_imp_shared.create_automation_action(
 p_id=>wwv_flow_imp.id(60477555827805245)
,p_automation_id=>wwv_flow_imp.id(42307092352868363)
,p_name=>'Save Coordinates and POI for Address'
,p_execution_sequence=>40
,p_action_type=>'NATIVE_PLSQL'
,p_action_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'update eba_demo_addresses',
'   set longitude = :LONGITUDE,',
'       latitude  = :LATITUDE,',
'       poi       = :POI',
' where id        = :ID;'))
,p_action_clob_language=>'PLSQL'
,p_location=>'LOCAL'
,p_stop_execution_on_error=>true
);
